import React from 'react'

export default function Filters() {

    const {
        handleTagSelected
    } = props;

    return (
        <div className="page-filters">
            <div onClick={handleTagSelected} className={`filter ${this.state.activeDiv === "all" ? "active" : ""}`} data-filter="all"><span className="icon-all"></span><p>All</p></div>
            <div onClick={handleTagSelected} className={`filter ${this.state.activeDiv === "new" ? "active" : ""}`} data-filter="new"><span className="icon-new"></span><p>New</p></div>
            <div onClick={handleTagSelected} className={`filter ${this.state.activeDiv === "top" ? "active" : ""}`} data-filter="top"><span className="icon-top"></span><p>Top</p></div>
        </div>
    )
}
